Interpretation:
MCH level is above the normal range
The mean cell hemoglobin per red blood cell has no independent value and always correlates with the MCV and MCHC. A high MCH (hyperchromia) may be caused by: vitamin B12 metabolism disorders or deficiency (megaloblastic anemia);
some chronic hemolytic anemias; hypoplastic anemia due to severe blood loss;
hypothyroidism; liver diseases;
metastases from malignancies;
cytostatic drugs, contraceptives, anticonvulsant drugs.

Mean Corpuscular Hemoglobin Concentration (MCHC) is increased
Increased mean corpuscular hemoglobin concentration (MCHC) may be associated with hereditary spherocytosis and other types of spherocytic anemia.

MCV level is below the normal range
The mean corpuscular volume (MCV) may be low due to: hypochromic and microcytic anemia, including iron-deficiency anemia, anemia due to chronic illnesses, thalassemia;
some hemoglobinopathies; occasionally due to hyperthyroidism.

Hemoglobin level is lower than normal
A condition in which you have a low hemoglobin count is called anemia. Anemia may be caused by iron or vitamin (B12, folic acid) deficiency, blood loss, as well as blood disorders associated with the destruction of red blood cells. Blood transfusion may cause low hemoglobin levels as well. A slightly lower than normal hemoglobin count may be caused by the hormone fluctuations and blood loss associated with the menstrual cycle. Iron-deficiency anemia is the most common type of anemia. The best indicators of your body's total iron stores are blood iron level and your serum ferritin level. Iron-deficiency anemia causes pale skin, increased fatigability, general weakness, dyspnea, vertigo, brittle nails and hair, dry skin and mucous membranes.

Decreased hematocrit levels
A low hematocrit may be due to: severe bleeding;
anemia; pregnancy, especially in the second half of pregnancy;
increased blood volume (due to the consumption of excessive amounts of water, infusion of excessive amounts of normal saline); decreased production of red blood cells by the bone marrow; increased destruction of red blood cells.

Hemoglobin level is higher than normal
Physical activity causes an increase in hemoglobin levels. Hemoglobin concentrations are higher in mountain climbers and pilots following high-altitude flights, as well as in people living in mountain regions. Even some fresh air may lead to a slight increase in hemoglobin. High hemoglobin levels may be caused by: erythrocytosis (an increase in red blood cell numbers);
hemoconcentration; congenital heart disease; bowel obstruction; burns; cardiopulmonary decompensation. Hemoglobin levels in fingerstick blood samples are generally higher than those in venous samples by 3 to 5 g/l. High hemoglobin levels may also be caused by smoking.
